import React from 'react';
import { Card } from 'react-bootstrap';
import './Style.css';
import selfPicture from './../img/selfPicture.png';
import { FaFacebook, FaGithub, FaLinkedin } from 'react-icons/fa';

function PictureContainer() {

    return (
        <Card id="picture_container" style={{backgroundColor: "#727e94", borderStyle: 'none'}}>
          <Card.Img variant="top" src={selfPicture} id="selfPicture" />
          <Card.Title className="card-text">Andrea Pallotta</Card.Title>
          <Card.Subtitle className="card-text">
            3rd Year Student at Rochester Institute of Technology
          </Card.Subtitle>
          <br />
          <Card.Text>
            B.S. Web and Mobile Computing
            <Card.Link href="#"><FaFacebook size={32} color={'#3B5998'}></FaFacebook></Card.Link>
            <Card.Link href="#"><FaLinkedin size={32} color={'#0E76A8'}></FaLinkedin></Card.Link>
            <Card.Link href="#"><FaGithub size={32} color={'#4078C0'}></FaGithub></Card.Link>
          </Card.Text>
        </Card>
      );
}

export default PictureContainer;
